import GuitarCard from './guitar-card';
import { Guitar } from '../types/types';
import Pagination from './pagination';
import FilterCard from './filter-card';


type CatalogCardProps = {
  guitars: Guitar[];
};

function CatalogCard({ guitars }: CatalogCardProps): JSX.Element {

  return (
    <div className="catalog">
      <FilterCard guitars={guitars} />
      <div className="catalog-sort">
        <h2 className="catalog-sort__title">Сортировать:</h2>
        <div className="catalog-sort__type">
          <button className="catalog-sort__type-button" aria-label="по цене"
            // onClick={() => {
            //   // setIsSorting()
            // }}
          > по цене
          </button>
          <button className="catalog-sort__type-button" aria-label="по популярности"
            // onClick={() => {
            // }}
          >по популярности
          </button>
        </div>
        <div className="catalog-sort__order">
          <button className="catalog-sort__order-button catalog-sort__order-button--up" aria-label="По возрастанию"></button>
          <button className="catalog-sort__order-button catalog-sort__order-button--down" aria-label="По убыванию"></button>
        </div>
      </div>
      <div className="cards catalog__cards">
        {guitars && guitars.map((guitar: Guitar) => (
          <GuitarCard {...{ guitar }} key={guitar.id} />))}
      </div>
      <Pagination />
    </div>
  );
}

export default CatalogCard;
